import React from 'react';
import LogoTop from '../assets/components/LogoTop';
import { ReactComponent as Loader } from '../assets/images/loader.svg'

export default function RoomGame(props) {

    return (
        <>
            <LogoTop />
            <div className='py-20 text-center'>
                <h2>Rooms</h2>
            </div>
            <div className="container mx-auto py-20 ">
                <div className="columns-2">
                    <div className=' text-center '>
                        {props.host
                            ? (<button className="bg-white font-extrabold text-xl text-[#1B48E9] hover:opacity-90 rounded w-1/3 h-full justify-self-center my-2 disabled:opacity-60" >START</button>)
                            : (<div className=''>
                                
                                <label className='text-2xl font-bold'>Waiting for host to start...</label>
                                <Loader className='animate-spin' />
                            </div>) }
                    </div>
                    <div className='text-center'>
                        ola
                    </div>

                </div>
            </div>
        </>

    );

};
